def process_operations(n, m, a, operations):
    results = []
    fib_cache = [2, 1]

    def fib(i):
        while len(fib_cache) <= i:
            fib_cache.append(fib_cache[-1] + fib_cache[-2])
        return fib_cache[i]
    for operation in operations:
        t = operation[0]
        if t == 1:
            (x, v) = (operation[1], operation[2])
            a[x - 1] = v
        elif t == 2:
            (l, r) = (operation[1], operation[2])
            s = 0
            for i in range(l - 1, r):
                s += fib(i - (l - 1)) * a[i]
            results.append(s % 1000000000)
        elif t == 3:
            (l, r, d) = (operation[1], operation[2], operation[3])
            for i in range(l - 1, r):
                a[i] += d
    return results

